import React from 'react';

class PodcastCard extends React.Component {
    constructor(props) {
        super(props);
        }

    render() {
        const { key, id, name, email, image } = this.props;
        return (
            <div>
                <img src={image} alt="podcast" />
                <div>
                    <h2>{name}</h2>
                    
                </div>
            </div>
        )    
    }
    
}

export default PodcastCard;
